778\uAC00 \uC5F4\uC2EC\uD788 \uD588\uB2E4\uB294 \uBFCC\uB4EF\uD55C \uB290\uB08C\uC740 \uC788\uB2E4. \uD558\uC9C0\uB9CC, \uC0DD\uAC01\uD574\uBCF4\uBA74 \uAE30\uAC04 \uB0B4\uC5D0 \uC644\uB8CC\uD558\uC9C0 \uBABB\uD55C \uAC83\uC774 \uC0AC\uC2E4\uC774\uAE30\uB3C4 \uD558\uB2E4. \uBC24\uC744 \uC0C8\uC11C, \uC5F4\uC2EC\uD788 \uD588\uB2E4\uB294 \uCE6D\uCC2C\uC744 \uB4E4\uC5B4\uC57C \uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C, \uAE30\uAC04 \uB0B4\uC5D0 \uC644\uC218\uD558\uC9C0 \uBABB\uD588\uB2E4\uB294 \uC695\uC744 \uBA39\uC5B4\uC57C\uD558\uB294 \uAC83\uC774\uB2E4. \uC774\uB7F0 \uC0C1\uD669\uC774 \uC77C\uBC18\uC801\uC778 \uD68C\uC0AC\uC5D0\uC11C\uB3C4 \uC77C\uC5B4\uB098\uB294 \uD604\uC0C1\uC77C\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB2E4. \uB0A8\uB4E4 \uB2E4 \uD1F4\uADFC\uD558\uB294\uB300\uB3C4, \uB2A6\uAC8C\uAE4C\uC9C0 \uC57C\uADFC\uD558\uBA74\uC11C, \uC77C\uD558\uB294 \uCC99\uD558\uB294 \uAC83\uACFC \uBE44\uC2B7\uD55C \uAC83 \uC544\uB2D0\uAE4C? \uC2DC\uAC04\uC774\uB77C\uB294 \uAC83\uC774 \uAE38\uC5B4\uC9C0\uBA74 \uAE38\uC5B4\uC9C0\uB294\uB300\uB85C, \uB290\uC2A8\uD574\uC838\uC11C \uC77C\uC758 \uCC98\uB9AC\uB3C4 \uB290\uC2A8\uD574\uC9C0\uB294 \uAC83\uCC98\uB7FC. \uC5F4\uC2EC\uD788\uB294 \uD558\uB294 \uAC83\uCC98\uB7FC \uBCF4\uC774\uC9C0\uB9CC, \uC2E4\uC81C\uB85C\uB294 \uC81C\uB300\uB85C \uBABB\uD558\uACE0 \uC788\uB294 \uAC83 \uC544\uB2D0\uAE4C. \uC5B4\uCA4C\uBA74 \uB098\uC5D0\uAC8C\uB3C4 \uC774\uB7F0 \uC0C1\uD669\uB4E4\uC744 \uB098\uB3C4 \uBAA8\uB974\uAC8C \uD558\uACE0 \uC788\uC744 \uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E4\uC5C8\uB2E4. \uC624\uB298\uACFC \uAC19\uC740 \uC0C1\uD669\uB4E4. \uB098\uB3C4 \uB531 \uADF8 \uC0C1\uD669\uC774\uC5C8\uB358 \uAC83 \uAC19\uB2E4. \uBC24\uC0C8\uBA74\uC11C \uC5F4\uC2EC\uD788 \uD574\uC11C \uACE0\uC0DD\uD588\uB2E4\uB294 \uC774\uC57C\uAE30\uB97C \uB4E3\uACE0 \uC2F6\uC9C0\uB9CC, \uC2E4\uC81C\uB860 \uB0A8\uB4E4\uC774 \uBCF4\uAE30\uC5D0\uB294 \uAE30\uAC04\uB0B4\uC5D0 \uCC98\uB9AC \uBABB\uD55C \uBB34\uB2A5\uB825\uC790\uB85C \uBC